    "necedah-national-wildlife-refuge-narrative-report-january-february-march-april-1962",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from January through April of 1962. The report begins by
    summarizing the weather conditions, habitat conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, mammals, raptors, reptiles, fish, and disease- is
    also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and wildfires. Resource management
    is outlined; topics include fur harvesting and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
